from typing import List

class Solution:
    def nearestExit(self, maze: List[List[str]], entrance: List[int]) -> int:
        from collections import defaultdict
        from queue import Queue
        m = len(maze)
        n = len(maze[0])
        mark = defaultdict(lambda: False)
        
        def is_exit(cell):
            return maze[cell[0]][cell[1]] == "." and (
                cell[0] == 0 or cell[0] == m-1 or cell[1] == 0 or cell[1]==n-1)
        
        def neighbors(cell):
            return [(i,j) for (i, j) in [(cell[0]-1, cell[1]), (cell[0] + 1, cell[1]), 
                                       (cell[0], cell[1]-1), (cell[0], cell[1]+1)] if (
                                           0<=i<m and 0<=j<n and maze[i][j]=="." and not mark[(i, j)])]
        
        q = Queue()
        q.put([entrance, 0])
        maze[entrance[0]][entrance[1]] = "+"
        mark[(entrance[0], entrance[1])] = True
        while not q.empty():
            cell, step = q.get()
            
            if is_exit(cell):
                return step
            
            for next_cell in neighbors(cell):
                mark[next_cell] = True
                q.put([next_cell, step+1])
        
        return -1
    
